@Override
public Explanation explain(int doc, Explanation freq) {
  Explanation expl = new Explanation(score(doc, (int)freq.getValue()), "sum of:");
  for (ExactDocScorer subScorer : subScorers) {
    expl.addDetail(subScorer.explain(doc, freq));
  }
  return expl;
}

